import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import Sdata from './Sdata';

ReactDOM.render(
    <>
    <App 
        imagesrc={Sdata[0].imagesrc}
        title={Sdata[0].title}
        sname={Sdata[0].sname}
        link={Sdata[0].link} />

    <App 
         imagesrc={Sdata[1].imagesrc}
        title={Sdata[1].title}
        sname={Sdata[1].sname}
        link={Sdata[1].link} />

    <App 
         imagesrc={Sdata[2].imagesrc}
        title={Sdata[2].title}
        sname={Sdata[2].sname}
        link={Sdata[2].link} />

    <App 
         imagesrc={Sdata[3].imagesrc}
        title={Sdata[3].title}
        sname={Sdata[3].sname}
        link={Sdata[3].link} />
        </>,
   document.getElementById('root')
);
